import React, { Component } from 'react'
import {Button} from 'react-bootstrap'

export default class Update extends Component {
  render() {
    return (
      <>    
      <td>{this.props.item.id}</td>
     <td>{this.props.item.name}<br/><br/> <Button variant="danger" >Delete</Button> </td>
      <td><img src={this.props.item.avatar} alt="image" title="Image"/>  </td>

      </>
    )
  }
}
